import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ServiceBooking.css';
import { TextField, Button, MenuItem } from '@mui/material';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { isValid, format } from 'date-fns';

const ServiceBooking = ({ selectedService = '', setSelectedService }) => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    service_type: selectedService,
    preferred_date: '',
    message: '',
  });

  const [dateObject, setDateObject] = useState(null);
  const [submitted, setSubmitted] = useState(false);
  const [ticketId, setTicketId] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    setFormData((prev) => ({ ...prev, service_type: selectedService }));
  }, [selectedService]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === 'service_type' && setSelectedService) {
      setSelectedService(value);
    }
    setFormData({ ...formData, [name]: value });
  };

  const handleDateChange = (date) => {
    if (isValid(date)) {
      setDateObject(date);
      setFormData({ ...formData, preferred_date: format(date, 'yyyy-MM-dd') });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setTicketId('');

    const token = localStorage.getItem('access_token');
    if (!token) {
      setError('⚠️ You must be logged in to book a service.');
      return;
    }

    const parsed = new Date(formData.preferred_date);
    if (!isValid(parsed) || parsed < new Date().setHours(0, 0, 0, 0)) {
      setError('Please select a valid future date.');
      return;
    }

    try {
      const response = await axios.post(
        'http://localhost:8000/api/bookings/',
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
        }
      );

      setSubmitted(true);
      setTicketId(response.data.ticket_id);
    } catch (error) {
      console.error('❌ Booking submission failed:', error);
      if (error.response?.status === 401 || error.response?.status === 403) {
        setError('Authentication failed. Please log in again.');
      } else {
        const msg = error.response?.data?.message || 'Booking submission failed. Please try again.';
        setError(Array.isArray(msg) ? msg.join(', ') : msg);
      }
    }
  };

  return (
    <div className="book-service-form">
      <h2>Book a Smart Home Service</h2>
      {submitted ? (
        <div className="success-message">
          <p>✅ Thank you! Your service ticket has been created.</p>
          <p><strong>Ticket ID:</strong> {ticketId}</p>
        </div>
      ) : (
        <form onSubmit={handleSubmit} className="mui-form">
          <TextField
            name="name"
            label="Name"
            fullWidth
            margin="normal"
            value={formData.name}
            onChange={handleChange}
            required
          />
          <TextField
            name="phone"
            label="Phone"
            fullWidth
            margin="normal"
            value={formData.phone}
            onChange={handleChange}
            required
          />
          <TextField
            name="service_type"
            label="Service Type"
            fullWidth
            margin="normal"
            select
            value={formData.service_type}
            onChange={handleChange}
            required
          >
            <MenuItem value="Basic Package">Basic Package</MenuItem>
            <MenuItem value="Plus Package">Plus Package</MenuItem>
            <MenuItem value="Full Automation">Full Automation</MenuItem>
          </TextField>

          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <DatePicker
              label="Preferred Date"
              value={dateObject}
              onChange={handleDateChange}
              minDate={new Date()}
              inputFormat="yyyy-MM-dd"
              renderInput={(params) => (
                <TextField
                  {...params}
                  fullWidth
                  margin="normal"
                  required
                />
              )}
            />
          </LocalizationProvider>

          <TextField
            name="message"
            label="Additional Message"
            fullWidth
            margin="normal"
            multiline
            rows={3}
            value={formData.message}
            onChange={handleChange}
          />

          <Button type="submit" variant="contained" color="primary">
            Submit
          </Button>

          {error && (
            <p className="error-message" style={{ color: '#F44336', marginTop: '15px' }}>
              {error}
            </p>
          )}
        </form>
      )}
    </div>
  );
};

export default ServiceBooking;
